window.bookSummaryJSON = "<p>Once I was a mortal man living on Earth, but now, I’m the Tempest Demon known as Atticus, and I have served the Dark King for eons as he wages endless war across the realms.&nbsp;</p> <p>Until today, when I finally ripped myself free from the Dark King’s shackles. The demons want me back. The heavens want me destroyed.&nbsp;</p> <p>Each side will send their minions after me, but the men I will crush, and the women I will tame with my demon-seed before I add them to my harem.&nbsp;</p> <p>I was born on Earth and made in hell, but now, I am free to rule all worlds.</p>"; 
